class Solution {
  public String getPermutation(int n, int k) {
    List<Integer> nums = new ArrayList<>();
    for (int i = 1; i <= n; i++) {
      nums.add(i);
    }

    int[] fact = new int[n];
    fact[0] = 1;
    for (int i = 1; i < n; i++) {
      fact[i] = i * fact[i - 1];
    }

    k = k - 1;
    StringBuilder sb = new StringBuilder();
    for (int i = n - 1; i >= 0; i--) {
      int index = k / fact[i];
      k = k % fact[i];
      sb.append(nums.get(index));
      nums.remove(index);
    }

    return sb.toString();
  }
}
